import React, { Fragment } from "react";
import { Header } from "components/widgets";
import { useCustomState } from "state/state";
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
}));

export default () => {
  const state = useCustomState()[0];
  const classes = useStyles();
  
  const handleChange = (event) => {
    setAreacode(event.target.value);
  };

  return (
    <Fragment>
      <Header img={state.data.header_bgs.contacts}>관광지 개별입력</Header>
      <div>
      <FormControl className={classes.formControl}>
        <InputLabel id="demo-simple-select-label">areacode</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={areacode}
          onChange={handleChange}
        >
          <MenuItem value={10}>A01</MenuItem>
          <MenuItem value={20}>A02</MenuItem>
          <MenuItem value={30}>A03</MenuItem>
          <MenuItem value={30}>A04</MenuItem>
          <MenuItem value={30}>A05</MenuItem>
          <MenuItem value={30}>B01</MenuItem>
          <MenuItem value={30}>B02</MenuItem>
          <MenuItem value={30}>C01</MenuItem>
        </Select>
      </FormControl>
      </div>
    </Fragment>
  );
};
